import React, { useEffect } from 'react';
import UsersForm from './Components/Users/UsersForm';
import firebase from './firebase';

function App() {
  React.useEffect(()=>{
    const msg=firebase.messaging();
    msg.requestPermission().then(()=>{
      return msg.getToken();
    }).then((data)=>{
      console.warn("token",data)
    })
  })
  return (
    <div><UsersForm/></div>

  );
}

export default App;
